import React from "react";
import "./headsect.css";
import logo from "../../Images/logo.png";

const headsect = () => {
  return (
    <header>
      <nav>
        <div>
          <img src={logo} alt="" width="50" height="50" />
        </div>
        <div>NAVIGATION</div>
      </nav>

      <div class="hero">
        <div class="hero__inner">
          <h1 class="hero__heading">
            The <span class="hero--highlight">Best </span> <br /> NEWS
            AGGREGATOR
          </h1>
          <p class="hero__content">
            Lorem, ipsum dolor sit amet consectetur adipisicing elit. Molestiae
            est esse voluptates exercitationem cum, animi error. Iure inventore
            quidem et sit delectus voluptas consequatur totam.
          </p>
          <button class="hero__btn">JOIN US</button>
        </div>
      </div>
    </header>
  );
};

export default headsect;
